import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import classnames from "classnames";

class Profile extends Component {

    render() {
        const profile = this.props.auth.user
        console.log(profile)
        return (
            <div className="container">
                <div className="row"> 
                <div className="col s12 center-align">
                    <h5>
                        <b>Perfil</b>
                    </h5>
                    <br/>
                </div>
                </div>
                <div className="row">
                    <div className="col s3">
                        Nombre: <input type="text" value={profile.name}/>
                    </div>
                </div>
                <div className="row">
                    <div className="col s3">
                        Email: <input type="text" value={profile.email}/>
                    </div>
                </div>
                <div className="row">
                    <div className="col s3">
                        Constrase√±a: <button style={{
                                                    width: "130px",
                                                    borderRadius: "3px",
                                                    letterSpacing: "1.5px",
                                                    marginTop: "1rem" }} 
                                                    className="btn btn-medium waves-effect waves-light hoverable blue accent-3">
                                                        Cambiar
                                    </button>
                    </div>
                </div>
            </div>
        )
    }
}

Profile.propTypes = {
    auth: PropTypes.object.isRequired
}

const mapStateToProps = state => ({
    auth: state.auth
});

export default connect(
    mapStateToProps,
    {}
)(Profile)
